          <img src="" alt="zagazine" />
          <div className="section-container"></div>
        </div>
        <Link to="/list_articles/drink_food">Drinks & Foot</Link>
        <Link to="/list_articles/moda">Moda</Link>
      </header>
      <Outlet />
      <footer>soy el pie</footer>
    </div>
  );
}

export default Layout;
